import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import CusButton from "./components/button";
import ButtonAppBar from './partial/components/navbar';
import CoverFlowCarousel from "./components/carousel/carousel";
import FooterPage from "./partial/components/footer";
import AutoGrid  from "./components/Grid/mainGrid";
import NavbarPage  from './partial/components/navbar'

class App extends Component {
  render() {
    return (
      <div className="App">
        <NavbarPage />
        <CoverFlowCarousel />
        {/* <h1>Badar Shahzad</h1> */}
        <div className="container main-content" >
          <AutoGrid />
        </div>
        <FooterPage />
      </div>
    );
  }
}

export default App;
